import React from 'react'

const Home = () => {
    return(
        <section className='hero'>
            <h1>Our collectibles are endless.</h1>
            <div></div>
            <h3>Here at Infinite Collectibles, we're proud to bring you some of the best anime merchanidse known to man, woman, and shinigami.</h3>
        </section>
    )
}
export default Home
